    const deltNote = () =>{
        props.remitem
    }

return (
    <>
    <div className="note">
    <h1> {props.title}</h1>
    <br/>
    <p>{props.content}</p><br/>
    <Button onClick={deltNote} variant="contained" color="primary"><RemoveIcon/></Button>   
    </div>
    </>

);

};

export default Note;
